import React, { Fragment, useState, useEffect } from 'react';
import {
	View,
	Button,
	Text,
	Image,
} from 'react-native';

import { BluetoothManager } from 'react-native-datecs-connector';

const App = () => {
	const [dispositivos, setDispositivos] = useState([]);
	const [encontrados, setEncontrados] = useState([]);
	const [pareados, setPareados] = useState([]);
	const teste = () => {
		BluetoothManager.scanDevices()
			.then((s) => {
				var ss = JSON.parse(s);//JSON string
				setPareados(ss.paired || []);
				setEncontrados(ss.found || []);
			}, (err) => {
				alert(err);
			});

	}
	useEffect(() => {
		teste();
	}, [])

	const connect = (address) => {
		BluetoothManager.connect(address) // the device address scanned.
			.then((s) => {
				alert(s);
				// BluetoothManager.oficializar();
			}, (e) => {
				alert(e);
			})
	}

	const imprimri = () => {
		let brasao = '';
		let brasaoBase64 = `{br}{image=${brasao}}`;
		let template = `{br}{br}{center}{b}AUTO DE INFRAÇÃO : AI/19-KHG67Y {reset}`;
		template = template.concat(brasaoBase64);
		BluetoothManager.printerTemplate(template);
	}

	return (
		<View>
			<Button title="PRIME" onPress={() => imprimri()}></Button>
			<View style={{ marginBottom: 20 }}>
				<Text>Encontados</Text>
				{encontrados.length > 0 && encontrados.map((dispositivo, index) => {
					return (
						<View key={index}>
							<Button title={dispositivo.name}></Button>
							<Button title={dispositivo.address} onPress={() => connect(dispositivo.address)}></Button>
						</View>
					)
				})}
			</View>
			<View style={{ marginBottom: 20 }}>
				<Text>Pareados</Text>
				{pareados.length > 0 && pareados.map((dispositivo, index) => {
					return (
						<View key={index}>
							<Button title={dispositivo.name}></Button>
							<Button title={dispositivo.address} onPress={() => connect(dispositivo.address)}></Button>
						</View>
					)
				})}
			</View>
		</View>

	);
};

export default App;
